import React from 'react';

const App = () => {
  const dados = produtos.filter(
    ({ preco }) => Number(preco.replace('R$ ', '')) > 1500,
  );
  console.log(dados);

  return (
    <section>
      {produtos
        .filter(({ preco }) => Number(preco.replace('R$ ', '')) > 1500)
        .map((item) => (
          <div key={item.id}>
            <h1>{item.nome}</h1>
            <p>Preço R$ {item.preco}</p>
            <ul>
              {item.cores.map((cor) => (
                <li key={cor} style={{ backgroundColor: cor, color: 'white' }}>
                  {cor}
                </li>
              ))}
            </ul>
          </div>
        ))}
    </section>
  );
};

export default App;
